$(function(){$("#datePicker").datetimepicker(Core.dateTimePickerDateOptions);$("#timePicker").datetimepicker(Core.dateTimePickerTimeOptions);$('[data-toggle="tooltip"]').tooltip()});const App=new Vue({el:"#app",data:function(){return{stations:[],station:{},model:{stationId:1}}},created:function(){Core.populateStationDropdown(this,!1);axios.get("/data/Station").then(function(n){self.meteorologicalData=n.data;Vue.nextTick(function(){self.now=new Date;$('[data-toggle="tooltip"]').tooltip({boundary:"span",placement:"left"})})}).catch(function(n){console.log("getMeteorologicalData failed",n)})},computed:{currentDate:function(){return moment().format("MM/DD/YYYY")},currentTime:function(){return moment().format("HH:mm:ss")}},watch:{"model.stationId":function(n){axios.get("/data/Station?id="+n).then(function(n){self.meteorologicalData=n.data;Vue.nextTick(function(){self.now=new Date;$('[data-toggle="tooltip"]').tooltip({boundary:"span",placement:"left"})})}).catch(function(n){console.log("getMeteorologicalData failed",n)})}}});